const t="<span style=\"font-size: 32px; font-weight: 600;\">\u5E38\u7528\u6307\u4EE4</span>\n\n## \u57FA\u672C\u4ECB\u7D39\u8207\u5B89\u88DD\n- \u4EC0\u9EBC\u662F ```Vuex``` ?\uFF1A\n  ```txt\n  \u4E00\u500B\u7A0B\u5E8F\u88E1\u9762\u7684\u72C0\u614B\u7BA1\u7406\u6A21\u5F0F\uFF0C\u96C6\u4E2D\u5F0F\u5B58\u5132\u6240\u6709\u7D44\u4EF6\u7684\u72C0\u614B\u7684\u5C0F\u5009\u5EAB\uFF0C\n  \u4E26\u4FDD\u6301\u5B58\u5132\u7684\u72C0\u614B\u4EE5\u4E00\u7A2E\u53EF\u9810\u6E2C\u7684\u65B9\u5F0F\u767C\u751F\u8B8A\u5316\u3002\n  ```\n- \u5B89\u88DD\u4F7F\u7528\u65B9\u5F0F\u8ACB\u67E5\u770B[\u5B98\u7DB2](https://vuex.vuejs.org/zh/installation.html)\n- \u4E3B\u8981\u4F5C\u7528\uFF1A\u65B9\u4FBF\u4EFB\u4F55\u7D44\u4EF6\u96A8\u6642\u53EF\u53D6\u5F97\u8CC7\u6599\u5B58\u5132\u7684\u72C0\u614B\uFF0C\u89E3\u6C7A\u7D44\u4EF6\u9593\u4E92\u50B3\u8CC7\u6599\u72C0\u614B\u7684\u56F0\u96E3\n- \u8CC7\u6599\u72C0\u614B\u66F4\u65B0\u6D41\u7A0B\uFF1A\n  - \u540C\u6B65\uFF1A\n    ```txt\n    Vue   commit                       \u6E32\u67D3\n    \u7D44\u4EF6 --------> mutations -> state ------> \u7D44\u4EF6\n    ```\n  - \u7570\u6B65\uFF1A\n    ```txt\n    Vue   dispatch    \u547C\u53EB    commit                       \u6E32\u67D3\n    \u7D44\u4EF6 ----------> actions --------> mutations -> state ------> \u7D44\u4EF6\n    ```\n\n## state \u8207 mapState\n- \u4F7F\u7528\u65B9\u5F0F\uFF1A\n  - \u547C\u53EB ```store``` \u7684 ```state``` \u65B9\u6CD5\n  - \u4F7F\u7528 ```mapState``` \u53D6\u5F97 ```state``` \u9032\u884C\u4F7F\u7528\n- \u7BC4\u4F8B\uFF0C\u4EE5 ```vue-cli``` \u70BA\u4F8B\u5B50\uFF1A\n  - \u5728\u9019\u4E4B\u5F8C\u7BC4\u4F8B\u90FD\u6703\u4F7F\u7528\u8A72\u96DB\u5F62\uFF0C```main.js``` \u57FA\u672C\u4E0A\u4E0D\u6703\u66F4\u6539\n  - ```store/index.js```\n    ```js\n    // \u8A2D\u5B9A Vuex \u8CC7\u6599\n    import { createStore } from 'vuex'\n    export default createStore({\n      state: {\n        name: 'test',\n        number: 0,\n        list: [\n          { id: 1, name: '111' },\n          { id: 2, name: '222' },\n          { id: 3, name: '333' },\n        ]\n      }\n    })\n    ```\n  - ```main.js```\n    ```js\n    import { createApp } from 'vue'\n    import App from './App.vue'\n    import store from './store'\n    createApp(App).use(store).mount('#app')\n    ```\n  - ```App.vue```\n    ```html\n    <template>\n      <div>{{name}}</div>\n      <div>{{number}}</div>\n    </template>\n\n    <script>\n    import { mapState } from 'vuex';\n    export default {\n      mounted() {\n        // \u4F7F\u7528this.$store.state.XXX \u53EF\u76F4\u63A5\u8A2A\u554F Vuex state \u8CC7\u6599\u72C0\u614B\n        console.log(this.$store.state.name);// test\n      },\n      // \u5B98\u65B9\u5EFA\u8B701\uFF1A\u4F7F\u7528 computed \u4F86\u53D6\u5F97\u6700\u65B0\u7684\u8CC7\u6599\u72C0\u614B\n      computed: {\n        getName() {\n          return this.$store.state.name;\n        },\n        // \u5B98\u65B9\u5EFA\u8B702\uFF1A\u4F7F\u7528 mapStat \u66F4\u65B9\u4FBF\u53D6\u5F97\u8CC7\u6599\n        ...mapState(['name','number']),\n        // \u53EF\u4EE5\u53D6\u5225\u540D\n        ...mapState({ aliasName: 'name' })// test\n      },\n    }\n    <\/script>\n    ```\n\n## getters \u8207 mapGetters\n- \u4F7F\u7528\u5834\u666F\uFF1A\u9700\u8981\u5C0D\u8CC7\u6599\u72C0\u614B\u505A\u4FEE\u98FE\uFF0C\u4E26\u4E14\u591A\u500B\u7D44\u4EF6\u9700\u8981\u4F7F\u7528\n  - \u5982\u4F7F\u7528\u8005\u7A31\u547C\uFF1A\u6B61\u8FCE\uFF0C\u67D0\u67D0\u67D0 \u6539\u6210 \u60A8\u597D\uFF0C\u67D0\u67D0\u67D0\n- \u4F7F\u7528\u65B9\u5F0F\uFF1A\n  - \u547C\u53EB ```store``` \u7684 ```getters``` \u65B9\u6CD5\n  - \u4F7F\u7528 ```mapGetters``` \u53D6\u5F97 ```getters``` \u65B9\u6CD5\u9032\u884C\u4F7F\u7528\n- \u7BC4\u4F8B\uFF1A\n  - ```store/index.js```\n    ```js\n    import { createStore } from 'vuex'\n    export default createStore({\n      state: {\n        name: 'test',\n        number: 0,\n        list: [\n          { id: 1, name: '111' },\n          { id: 2, name: '222' },\n          { id: 3, name: '333' },\n        ]\n      },\n      // \u5728store\u5BF9\u8C61\u4E2D\u589E\u52A0getters\u5C5E\u6027\n      getters: {\n        // \u7372\u53D6\u4FEE\u98FE\u5F8C\u7684 name\uFF0C\u7B2C\u4E00\u500B\u53C3\u6578\u70BA\u5FC5\u8981\u53C3\u6578\n        getUserTitle(state) { \n          return `hello\uFF0C${state.name}`;\n        }\n      },\n    })\n    ```\n  - ```App.vue``` \u8B8A\u66F4\u4EE3\u78BC\uFF1A\n    ```js\n    import { mapGetters } from 'vuex';\n    export default {\n      mounted() {\n        // \u53EF\u4EE5\u4F7F\u7528 this.$store.getters \u7372\u53D6 getters\n        console.log(this.$store.getters.getUserTitle);// hello\uFF0Ctest\n      },\n      computed: {\n         // \u5B98\u65B9\u5EFA\u8B70\u53EF\u4EE5\u4F7F\u7528 mapGetters \u9032\u884C\u8ABF\u7528\n        ...mapGetters(['getUserTitle']), // hello\uFF0Ctest\n        // \u53EF\u4EE5\u53D6\u5225\u540D\n        ...mapGetters({ aliasName: 'getUserTitle' })// hello\uFF0Ctest\n      }\n    }\n    ```\n\n## mutations \u8207 mapMutations\n- \u70BA\u4F55\u9700\u8981 ```mutations``` ?\uFF1A\n  ```txt\n  Vuex \u5C31\u50CF\u4E00\u68DF\u5927\u6A13\n  \u82E5\u9700\u8981\u66F4\u6539\u5927\u6A13\u8A2D\u65BD\uFF0C\u6A13\u5C64\u6210\u54E1\u4E0D\u80FD\u96A8\u4FBF\u66F4\u6539(\u7121\u6CD5\u76F4\u63A5\u7528 state \u66F4\u6539)\n  \u9700\u8981\u7D93\u904E\u7533\u8ACB\u4E26\u7D93\u904E\u6D41\u7A0B\u624D\u80FD\u505A\u6539\u8B8A(mutations)\n  \u800C\u6A13\u5C64\u6210\u54E1\u90FD\u53EF\u4EE5\u7533\u8ACB(\u4EFB\u4F55\u7D44\u4EF6\u90FD\u53EF\u4F7F\u7528 mutations \u6539\u8B8A\u8CC7\u6599\u72C0\u614B)\n  ```\n- \u4F7F\u7528\u65B9\u5F0F\uFF1A\n  - \u547C\u53EB ```store``` \u7684 ```commit``` \u65B9\u6CD5\"\u540C\u6B65\"\u4FEE\u6539 ```Vuex``` \u8CC7\u6599\u72C0\u614B\n  - \u4F7F\u7528 ```mapMutations``` \u53D6\u5F97 ```mutations``` \u65B9\u6CD5\u9032\u884C\u4F7F\u7528\n- \u7BC4\u4F8B\uFF1A\n  - ```store/index.js```\n    ```js\n    import { createStore } from 'vuex'\n    export default createStore({\n      state: {\n        name: 'test',\n        number: 0,\n      },\n      // \u65B0\u589E mutations \u5C6C\u6027\n      mutations: {\n        // \u65B0\u589E setNumber \u65B9\u6CD5\n        setNumberFive(state) {\n          state.number = 5;\n        },\n        // \u5B98\u65B9\u5EFA\u8B70\u82E5\u8981\u50B3\u7B2C\u4E8C\u500B\u53C3\u6578\uFF0C\u53EF\u50B3\u5C0D\u8C61\u4E26\u547D\u540D\u70BA payload \n        setNumber(state, payload){\n          state.number = payload.number;\n        }\n      },\n    })\n    ```\n  - ```App.vue``` \u8B8A\u66F4\u4EE3\u78BC\uFF1A\n    ```js\n    import { mapMutations } from 'vuex';\n    export default {\n      mounted() {\n        // \u53EF\u4EE5\u4F7F\u7528 this.$store.commit \u547C\u53EB mutations \u7684\u65B9\u6CD5\n        console.log(this.$store.state.number);// 0\n        this.$store.commit('setNumberFive');\n        console.log(this.$store.state.number);// 5\n        this.$store.commit('setNumber', { number: 777 });// 777\n        this.setNumberIsAlias({ number: 999 });// 999\n      },\n      methods: {   \n        // \u9019\u908A\u9700\u6CE8\u610F\uFF0CmapMutations \u662F\u89E3\u69CB\u5230 methods \u88E1\u9762\u7684\uFF0C\u800C\u975E\u8A08\u7B97\u5C6C\u6027\n        ...mapMutations(['setNumber']),\n        // \u53EF\u4EE5\u53D6\u5225\u540D\n        ...mapMutations({ setNumberIsAlias: 'setNumber' }),\n      },\n    }\n    ```\n\n## actions \u8207 mapActions\n- \u70BA\u4F55\u9700\u8981 ```actions``` ?\uFF1A\n  ```txt\n  mutations \u8655\u7406\u540C\u6B65\uFF0Cactions \u8655\u7406\u7570\u6B65\n  \u5C31\u5982\u540C\u4E00\u500B\u8655\u7406\u570B\u5167\uFF0C\u4E00\u500B\u8655\u7406\u570B\u5916\u696D\u52D9(\u9700\u7B49\u5F85\u8F03\u9577\u6642\u9593)\n  ```\n- \u4F7F\u7528\u65B9\u5F0F\uFF1A\n  - \u547C\u53EB ```store``` \u7684 ```dispatch``` \u65B9\u6CD5\"\u7570\u6B65\"\u4FEE\u6539 ```Vuex``` \u8CC7\u6599\u72C0\u614B\n  - \u4F7F\u7528 ```mapActions``` \u53D6\u5F97 ```actions``` \u65B9\u6CD5\u9032\u884C\u4F7F\u7528\n- \u7BC4\u4F8B\uFF1A\n  - ```store/index.js```\n    ```js\n    import { createStore } from 'vuex'\n    export default createStore({\n      state: {\n        name: 'test',\n        number: 0,\n      },\n      mutations: {\n        setNumber(state, payload) {\n          state.number = payload.number;\n        },\n      },\n      // \u65B0\u589E actions \u5C6C\u6027\n      actions: {\n        // \u65B0\u589E setNumberFive \u65B9\u6CD5\uFF0C\u7B2C\u4E00\u500B\u53C3\u6578\u70BA content\uFF0C\u662F store \u5C0D\u8C61\n        setNumberFive(content) {\n          // \u6A21\u64EC\u7570\u6B65\u64CD\u4F5C\uFF0C\u4E00\u79D2\u5F8C\u4FEE\u6539 number\n          return new Promise(resolve => {\n            setTimeout(() => {\n              // \u547C\u53EB mutations \u5167\u7684 setNumber \u65B9\u6CD5\n              content.commit('setNumber', { number: 5 });\n              resolve();\n            }, 1000);\n          });\n        },\n        // content \u53EF\u4EE5\u76F4\u63A5\u89E3\u69CB\u51FA commit\uFF0C\u4E26\u53EF\u4EE5\u50B3\u7B2C\u4E8C\u500B\u53C3\u6578\n        setNumber({ commit }, payload) {\n          return new Promise(resolve => {\n            setTimeout(() => {\n              commit('setNumber', { number: payload.number });\n              resolve();\n            }, 1000);\n          });\n        }\n      }\n    })\n    ```\n  - ```App.vue``` \u8B8A\u66F4\u4EE3\u78BC\uFF1A\n    ```js\n    import { mapActions  } from 'vuex';\n    export default {\n      async mounted() {\n        // \u53EF\u4EE5\u4F7F\u7528 this.$store.dispatch \u547C\u53EB actions \u7684\u65B9\u6CD5\n        console.log(this.$store.state.number);// 0\n        await this.$store.dispatch('setNumberFive');\n        console.log(this.$store.state.number);// 5\n        await this.$store.dispatch('setNumber', { number: 777 });\n        console.log(this.$store.state.number);// 777\n        await this.setNumberAlias({ number: 999 })\n        console.log(this.$store.state.number);// 999\n      },\n      methods: {   \n        // \u9019\u908A\u9700\u6CE8\u610F\uFF0CmapActions \u662F\u89E3\u69CB\u5230 methods \u88E1\u9762\u7684\uFF0C\u800C\u975E\u8A08\u7B97\u5C6C\u6027\n        ...mapActions(['setNumber']),\n        // \u53EF\u4EE5\u53D6\u5225\u540D\n        ...mapActions({ setNumberAlias: 'setNumber' }),\n      },\n    }\n    ```\n";export{t as default};
